public PhaseTracking clone() {
  PhaseTracking clone = new PhaseTracking();
  super.copy(clone);
  clone.file = file;
  clone.size = size;
  for (Map.Entry<Step, StepTracking> entry: steps.entrySet()) {
    clone.steps.put(entry.getKey(), entry.getValue().clone());
  }
  return clone;
}
